GO
CREATE VIEW [dbo].[View_Drowmoney]
AS
SELECT        dbo.tb_withdraw.Project_id, dbo.tb_withdraw.User_id, dbo.tb_withdraw.Project_name, dbo.tb_withdraw.Date_go, dbo.tb_withdraw.Amount, dbo.tb_withdraw.Province_id, dbo.tb_withdraw.Date_applicant, dbo.tb_user.Firstname, 
                         dbo.tb_user.Lastname, dbo.tb_user.Department_id, dbo.tb_user.Position_id, dbo.tb_province.province_name, dbo.tb_position.Position_name, dbo.tb_department.Department_name
FROM            dbo.tb_department INNER JOIN
                         dbo.tb_user ON dbo.tb_department.Department_id = dbo.tb_user.Department_id INNER JOIN
                         dbo.tb_gender ON dbo.tb_user.Gender_id = dbo.tb_gender.Gender_id INNER JOIN
                         dbo.tb_position ON dbo.tb_user.Position_id = dbo.tb_position.Position_id INNER JOIN
                         dbo.tb_prename ON dbo.tb_user.Pre_name_id = dbo.tb_prename.Prename_id INNER JOIN
                         dbo.tb_withdraw ON dbo.tb_user.User_id = dbo.tb_withdraw.User_id INNER JOIN
                         dbo.tb_status ON dbo.tb_withdraw.Status_id = dbo.tb_status.Status_id INNER JOIN
                         dbo.tb_province ON dbo.tb_withdraw.Province_id = dbo.tb_province.province_id
GO
